IF OBJECT_ID('dbo.proc_transform_309', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_309;
GO
CREATE PROCEDURE dbo.proc_transform_309
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_309
    SET payload = LEFT(payload, 1000) + N'|V4-309|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_309;
END
